const openIdClient = require("openid-client");
openIdClient.Issuer.defaultHttpOptions = { timeout: 20000 };

const discover = openIdClient.Issuer.discover(
  process.env.AUTHORIZATION_WELLKNOWN
);

discover
  .then(async issuer => {
    console.log(issuer);
  })
  .catch(err => console.log(err));
